import React from "react";
import '../Assets/Styles/PagesComponentStyles.css'
import ProjectsComponent from "./ProjectsComponent";
import MoreInfoComponent from "./MoreInfoComponent";
import ContactMeComponent from "./ContactMeComponent";

function PagesComponent(props){
    switch (props.selectedPage) {
        case 'Projects':
          return <ProjectsComponent />;
        case 'MoreInfo':
          return <MoreInfoComponent />;
        case 'ContactMe':
          return <ContactMeComponent />;
        default:
            return<div><h1>HOla mundo</h1></div>
    }
}

export default PagesComponent;
